btw llumar;

use the keygen provided in the file, enter your name and e-mail adress then press generate, copy the number that pops up, then in the powr cd+g burner program, go to the unlock button on the top right of the screen and enter the details EXACTLY as you did on the keygen, then paste the generated code into the activation bit and u will be burning full tracks and more than five tracks in no time!!!

hope this helps :)
